xwikidoc.content:
{{info}}WebDAV support is available in XWiki Enterprise 1.7 and above.{{/info}}
The WebDAV feature exposes wiki content (attachments, page content) through the well-known [[WebDAV protocol>>http://en.wikipedia.org/wiki/WebDAV]]. This allows using WebDAV clients like DAVExplorer, file browsers like the Windows Explorer (XP), the Finder (MAC) or Nautilus (Linux) to directly browse and edit wiki content just as you would do for files in your local file system.
{{image reference="Features.WebDAV@XWikiWebDAV.png"/}}
//XWiki.org when seen while browsing it using a file manager over WebDAV//
More specifically here are some benefits of a webDAV-enabled XWiki installation:
* Mount an XWiki wiki content into the user's local file system. * Use local application programs to manipulate page content and attachments. * Easily perform batch operations on documents (e.g. add 100 attachments to a document).
{{warning}}XWiki's WebDAV implementation only supports **Basic Access Authentication** and it doesn't support locking and versioning DAV operations yet.{{/warning}}
= WebDAV Clients =
To use the XWiki-WebDAV interface you will require a WebDAV client installed on your computer, but this is not a big issue since nowadays operating systems have built-in WebDAV clients. However it should be noted that because of the number of WebDAV clients out there in the wild, we cannot cover how each of them can be used to communicate with XWiki-WebDAV. Also, these WebDAV clients may vary in behavior a lot; functionalities might not be unique across various clients or in the worst case, functionalities might even be broken on some clients. We'll keep updating this document with instructions on how to use various WebDAV clients to access the XWiki-WebDAV interface. In the mean time, if you find out that your particular WebDAV client has problems with accessing / using the XWiki-WebDAV interface, you may consult the [[community>>dev:Main.WebHome]] for reporting issues. Also, when you report an issue related to WebDAV, please try to be as informative as possible (include platform, client, xe version and how to reproduce the issue). Following is a list of WebDAV clients known to work with the XWiki-WebDAV interface:
* [[DAVExplorer>>Features.WebDAVDAVExplorer]] - Platform Independent * [[WebFolders>>Features.WebDAVWebFolders]] - Windows XP * [[WebDAV Redirector>>Features.WebDAVRedirector]] - Windows XP * [[NetDrive / WebDrive>>Features.WebDAVNetDriveOrWebDrive]] - Windows XP * [[BitKinex>>http://www.bitkinex.com/webdavclient]] - Freeware for Windows * [[Nautilus>>Features.WebDAVNautilus]] - Gnome (Linux) * [[Konqueror>>Features.WebDAVKonqeror]] - KDE (Linux) * [[Davfs2>>Features.WebDAVDavFs2]] - Linux
